harapan peningkatan implementasi FWS:
Penerapan FWS selama pandemi ini diharapkan dapat tetap dipertahankan setelah pandemi usai, dengan maksimal non WFH hanya 1-2 hari saja. Hal ini sudah terbukti sangat mungkin dan berdampak baik untuk dilakukan karena:
1. Sifat pekerjaan di unit kami yang sangat mendukung pekerjaan dilakukan secara remote;
2. Efisiensi/penghematan anggaran perjalanan dinas, penghematan penggunaan ATK kantor, penghematan listrik kantor, dll;
3. Peningkatan kesehatan fisik dan mental bagi pegawai selama WFH;
4. Penghematan waktu, tenaga, dan biaya yang harus dilakukan jika harus berangkat ke kantor, padahal semua pekerjaan sudah bisa dilakukan secara remote dari rumah;
5. Pencapaian hasil pekerjaan yang lebih efisien dengan fokus pekerjaan yang lebih tinggi ketika WFH dibandingkan dengan WFO yang banyak menghabiskan waktu dengan mengobrol sesama rekan/atasan;
6. Lebih mudah menerapkan Work Life Balance dengan sistem FWS/WFH dibandingkan harus WFO yang menghabiskan banyak waktu percuma di perjalanan PP Rumah-Kantor.

Saya sangat mendukung FWS, sangat baik untuk work life balance;
Waktu yang dihabiskan untuk perjalanan dari dan ke kantor dapat digunakan untuk memulai aktivitas pekerjaan lebih awal, berolahraga (pola hidup sehat), beribadah, dan aktivitas positif lainnya;
FWS menambah kedekatan dalam keluarga;
FWS sebaiknya terus dilaksanakan di lingkungan Kementerian Keuangan;
Kehidupan keluarga yang baik akan mendukung kinerja dan produktivitas yang baik pula.
